        original order preventing the DOJ from probing the classified documents during
        the special master review and requiring them to disclose the materials to
        the special master\",\"type\":\"text\"}],\"type\":\"paragraph\"}],\"type\":\"blockquote\"},{\"content\":[{\"text\":\"The
        most egregious part of the order by far was the inability for DOJ to review
        the documents marked as classified. In addition, I believe that, absent this
        amendment, the 11th Circuit would have made a stronger reversal\",\"type\":\"text\"}],\"type\":\"paragraph\"},{\"type\":\"blockquote\",\"content\":[{\"content\":[{\"type\":\"text\",\"text\":\"The
        three-judge panel \u2014 which included two Trump appointees \u2014 said Cannon,
        a fellow Trump-appointee, \\\"abused\\\" her discretion by barring the DOJ
        from continuing to investigate the classified documents seized from Trump's
        Mar-a-Lago residence and allowed investigators to resume their probe.\"}],\"type\":\"paragraph\"}]},{\"type\":\"paragraph\",\"content\":[{\"text\":\"Given
        all of this, I can see no reason to resolve lower than 75%. I would like to
        use this comment as an opportunity for any to voice an objection to this being
        resolved YES. If there is one that I think is reasonable, and I haven't resolved
        the market yet, I will not do so. Otherwise I will wait >= 24 hours, then
        resolve YES\",\"type\":\"text\"}]}],\"type\":\"doc\"}},{\"commenterPositionOutcome\":\"YES\",\"createdTime\":1664114264732,\"contractQuestion\":\"Will
